        <input
          onChange={props.handleInputChange}
          value={props.value}
          name="search"
          type="text"
          className="form-control"
          placeholder="search..."
          id="search"
          style={{width: "175px",display:"inline !important"}}
        />
           &nbsp;&nbsp;&nbsp;
      </div> 
    </form>

  );
}

export default FilterCity;
